OpenCarePlanTasks_1.query:
q = load "${App.Datasets.HLS_Task7_tp.FullyQualifiedName}";
q4 = group q by all;
q4 = foreach q4 generate unique(q4.'CarePlan_AccountId') as 'Total_Members';

q1 = filter q by 'CarePlan_IsClosed' == "false" && 'IsOverdue' == "true";
q1 = filter q1 by 'Status' in ["In Progress", "Not Started", "Waiting on someone else"];
result = group q1 by 'CarePlan_AccountId';
result = foreach result generate q1.'CarePlan_AccountId' as 'CarePlan_AccountId', coalesce(unique(q1.'CarePlan_AccountId'),0) as 'A', coalesce(unique(q1.'Task_Overdue_Days_Bucket'),0) as 'B';
result = order result by ('CarePlan_AccountId' asc);
summary = group result by 'CarePlan_AccountId';
summary = foreach summary generate sum(sum('A')) over([..] partition by all) as 'A_total', sum(sum('B')) over([..] partition by all) as 'B_total';
summary = limit summary 1;

q2 = filter q by 'CarePlan_IsClosed' == "false" && 'IsOverdue' == "true";
q2 = filter q2 by 'Status' in ["In Progress", "Not Started", "Waiting on someone else"];
q2 = filter q2 by date('ActivityDate_Year', 'ActivityDate_Month', 'ActivityDate_Day') in [.."1 week ago"];
result1 = group q2 by 'CarePlan_AccountId';
result1 = foreach result1 generate q2.'CarePlan_AccountId' as 'CarePlan_AccountId', coalesce(unique(q2.'CarePlan_AccountId'),0) as 'A', coalesce(unique(q2.'Task_Overdue_Days_Bucket'),0) as 'B';
result1 = order result1 by ('CarePlan_AccountId' asc);
summary1 = group result1 by 'CarePlan_AccountId';
summary1 = foreach summary1 generate sum(sum('A')) over([..] partition by all) as 'A_total1', sum(sum('B')) over([..] partition by all) as 'B_total1';
