q3 = group summary by all full,summary1 by all,q4 by all;
q3 = foreach q3 generate coalesce(sum(summary.'A_total'),0) as 'All_Data',coalesce(sum(summary1.'A_total1'),0) as 'Till_Last_Week',coalesce(sum(q4.'Total_Members'),0) as 'Total_Members1';
